object = {'title':'Store Information and Policies','url':'http://stores.ebay.com/PARIS-VARIETY/Store-Information-and-Policies.html','content':'<table border="1" cellpadding="0" cellspacing="0">	<tbody>		<tr valign="top">			<td width="33%">				<table border="0" cellpadding="0" cellspacing="5" width="100%">					<tbody>						<tr>							<td>								<font face="Arial, Helvetica, sans-serif" size="2"><b>About Us</b></font></td>						</tr>					</tbody>				</table>			</td>			<td width="67%">				<table border="0" cellpadding="0" cellspacing="5" width="100%">					<tbody>						<tr>							<td>								<font face="Arial, Helvetica, sans-serif" size="2">We do business by <strong>"The Golden Rule" </strong>and guarantee the best service before, during, and after your purchase! </font>								<p>								</p>								<font face="Arial, Helvetica, sans-serif" size="2">Be sure to click on "Follow this seller" in the Listing or "Add this store to favorites" in our store header above this listing or click on one of our buttons. You\'ll get our newlsletter so we can keep you informed of our new listings if you choose. </font>								<p>								</p>								<font face="Arial, Helvetica, sans-serif" size="2">If you have any issues or questions regarding your order, please let us know. We are always more than glad to help you. </font></td>						</tr>					</tbody>				</table>			</td>		</tr>		<tr valign="top">			<td width="33%">				<table border="0" cellpadding="0" cellspacing="5" width="100%">					<tbody>						<tr>							<td>								<font face="Arial, Helvetica, sans-serif" size="2"><strong>Terms and Conditions</strong><br />								Payment and shipment terms may vary on individual items.</font></td>						</tr>					</tbody>				</table>			</td>			<td width="67%">				<table border="0" cellpadding="0" cellspacing="5" width="100%">					<tbody>						<tr valign="top">							<td>								<font face="Arial, Helvetica, sans-serif" size="2"><b>Payment methods</b></font></td>							<td>							</td>							<td>								<font face="Arial, Helvetica, sans-serif" size="2"><b>Pay Pal</b> <img border="0" height="24" src="http://pics.ebaystatic.com/aw/pics/paypal/Visa_35x24.gif" width="35" /><img border="0" height="18" src="http://pics.ebaystatic.com/aw/pics/paypal/MasterCard_27x18.gif" width="27" /><img border="0" height="18" src="http://pics.ebaystatic.com/aw/pics/paypal/Discover_28x18.gif" width="28" /><img border="0" height="18" src="http://pics.ebaystatic.com/aw/pics/paypal/Amex_27x18.gif" width="27" /><img border="0" height="24" src="http://pics.ebaystatic.com/aw/pics/paypal/PPeCheck_36x24.gif" width="36" /><br />								Money Order/Cashiers Check. See Item Description<br />								NOTE: If using PayPal to pay, please USE THE CHECKOUT BUTTON (Buy Now) Otherwise, PLEASE READ the \'Payment Information\' Section of Listing for other options.</font></td>						</tr>						<tr>							<td colspan="3">								<img alt="" height="1" src="http://pics.ebaystatic.com/aw/pics/spacer.gif" width="1" /></td>						</tr>						<tr valign="top">							<td>								<font face="Arial, Helvetica, sans-serif" size="2"><b>Store ship-to locations</b></font></td>							<td>							</td>							<td>								<p>									<font face="Arial, Helvetica, sans-serif" size="2">WorldWide<br />									We ship 1st. Class, Media Mail, Priority Mail or UPS (lowest cost for item). </font></p>								<p>									<font face="Arial, Helvetica, sans-serif" size="2">If your purchase is FRAGILE, <br />									we send it Insured and we will ship it Priority Mail.</font></p>								<p>								</p>							</td>						</tr>						<tr valign="top">							<td>								<font face="Arial, Helvetica, sans-serif" size="2"><b>Shipping & Handling</b></font></td>							<td>							</td>							<td>								<font face="Arial, Helvetica, sans-serif" size="2">Buyer Pays Shipping & Handling</font></td>						</tr>						<tr valign="top">							<td>								<font face="Arial, Helvetica, sans-serif" size="2"><b>Sales tax</b></font></td>							<td>							</td>							<td>								<font face="Arial, Helvetica, sans-serif" size="2">NO Sales Tax</font></td>						</tr>						<tr valign="top">							<td>								<font face="Arial, Helvetica, sans-serif" size="2"><b>Customer Service & Return Policy</b></font></td>							<td>							</td>							<td>								<p>									<font face="Arial, Helvetica, sans-serif" size="2">We will do everything we can to make sure you are completely satisfied.</font></p>								<p>									<font face="Arial, Helvetica, sans-serif" size="2">If you have any questions, concerns, or suggestions, please E-Mail us using eBay\'s "Contact Buyer" link BEFORE buying to make sure you have all the details for an informed purchase. We will get back to you as soon as we can. </font></p>								<p>								</p>								<font face="Arial, Helvetica, sans-serif" size="2">We attempt to answer emails every day. If you do not receive reply from us within 2 days, we likely did not receive your email or you did not use eBays email interface to contact us or it is a weekend or holiday. </font>								<p>								</p>								<font face="Arial, Helvetica, sans-serif" size="2">We are not usually available on weekends or holidays but, we may still attempt to get back to you even then. If we do, It will likely be in the afternoon, after 12:30pm PST (Pacific Standard Time). </font>								<p>								</p>								<font face="Arial, Helvetica, sans-serif" size="2">For Personalized Gifts, we will gladly exchange your purchase at absolutely no charge to you, if we make an error on your personalization. However, if the error was a result of your entering incorrect information on the online order/personalization form, it will be your responsibility to re-pay for both the item and the shipping. Before hitting the form\'s submit button, please double-check the order/personalization form(s) and click on \'Yes\' where it asks if you have checked the form for errors.. </font>								<p>								</p>								<font face="Arial, Helvetica, sans-serif" size="2">In the unlikely event that we have shipped the wrong item, we will refund your entire purchase and shipping in both directions. Please contact us immediately for instructions. </font>								<p>								</p>								<font face="Arial, Helvetica, sans-serif" size="2">For other return issues, please contact us so we can take cre of you. </font>								<p>								</p>								<font face="Arial, Helvetica, sans-serif" size="2">If your item is fragile/costly, we add insurance before shipping. If the item arrives damaged, we\'ll process damage claims with the carrier and may request that you return the item. If you suspect damage in shipment, please retain original shipping containers and notify us immediately. </font>								<p>								</p>								<font face="Arial, Helvetica, sans-serif" size="2"><strong>NOTE:</strong> We must either receive the damaged item(s) back or, if the shipping costs are high, we will accept photos of the damage to the item(s). </font>								<p>								</p>							</td>						</tr>					</tbody>				</table>			</td>		</tr>		<tr valign="top">			<td width="33%">				<table border="0" cellpadding="0" cellspacing="5" width="100%">					<tbody>						<tr>							<td>								<font face="Arial, Helvetica, sans-serif" size="2"><b>Additional Store Information</b></font></td>						</tr>					</tbody>				</table>			</td>			<td width="67%">				<table border="0" cellpadding="0" cellspacing="5" width="100%">					<tbody>						<tr>							<td>								<p>									<font face="Arial, Helvetica, sans-serif" size="2">Our Feedback Policy is to always give Positive Feedback. All buyers will receive positive feedback once we have received the same. If you Feel, for any reason, that you cannot leave Positive Feedback, please contact us so we can work it out to everyone\'s satisfaction</font></p>								<p>								</p>							</td>						</tr>					</tbody>				</table>			</td>		</tr>	</tbody></table><div></div>'};
